import React from 'react';
import{useState,useEffect} from "react"
import secondpage from './secondpage';

function SecondFrontPage() {

const [data,setData]=useState([])
function click(){
fetch("https://www.themealdb.com/api/json/v1/1/search.php?s")
.then((response)=>response.json())
.then((datas)=>{
    console.log(datas.meals);
  const food=[{
      Instructions:datas.meals[0].strInstructions,
      image:datas.meals[0].strMealThumb,
      links:datas.meals[0].strYoutube,
  },    { Instructions:datas.meals[0].strInstructions,
       image:datas.meals[0].strMealThumb,
  links:datas.meals[0].strYoutube,
}]
      
    
    setData(food)
  
 })
.catch((e)=>{
    console.log(e);
})}
useEffect(()=>{
click()

},[])

 return <div>
   <secondpage  image={data.image}  Instructions={data.Instructions} videolinks={data.links}/>
   
  </div>;
}

export default SecondFrontPage;
